    false,nt"url": null,nt"notes": "NLCD 1992, NLCD 2001, NLCD 2006, and NLCD
    2011 are National Land Cover Database classification schemes based primarily on
    Landsat data along with ancillary data sources, such as topography, census and agricultural
    statistics, soil characteristics, wetlands, and other land cover maps. NLCD 1992
    is a 21-class land cover classification scheme that has been applied consistently
    across the conterminous U.S. at a spatial resolution of 30 meters. NLCD 2001 is
    a 16-class land cover classification scheme that also has been applied to the conterminous
    U.S. at a spatial resolution of 30 meters, and includes Alaska, Hawaii, and Puerto
    Rico. NLCD 2006 quantifies land cover change for the conterminous U.S. between the
    years 2001 to 2006. Generation of NLCD 2006 helped identify and correct issues in
    the NLCD 2001 land cover and impervious surface products only, and no changes were
    made to the NLCD 2001 canopy product. For additional information, go to http://www.mrlc.gov/.
    See http://viewer.nationalmap.gov/help for assistance with The National Map viewer,
    services, or metadata.",nt"license_title": null,nt"extras": [{ntt"key":
